/************************************************************
 *
 * Autor: Zoinks
 *
 * 446576656c6f7065723a20416e746f6e20506f6c656e79616b61 ****/

// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.15;

import "./abstract/Ownable.sol";
import "./abstract/ReentrancyGuard.sol";
import "./librarys/SafeMath.sol";
import "./librarys/SafeBEP20.sol";

contract SnacksStakingPool is Ownable, ReentrancyGuard {
    using SafeMath for uint256;
    using SafeBEP20 for IBEP20;

    // Whether a limit is set for users
    bool public hasUserLimit;

    // Whether it is initialized
    bool public isInitialized;

    //* Accrued token per share
    uint256 public accTokenPerShare;

    //* The block number when CAKE mining ends.
    uint256 public bonusEndBlock = 99999999;

    //* The block number when CAKE mining starts.
    uint256 public startBlock;

    //* The block number of the last pool update
    uint256 public lastRewardBlock;
    //* CAKE tokens created per block.
    uint256 public rewardPerBlock;

    // The reward token
    IBEP20 public rewardToken; // reward snacks token
    IBEP20 public rewardEthSnacksToken;
    IBEP20 public rewardBtcSnacksToken;

    // The staked token
    IBEP20 public stakedToken;

    // Seniorage address
    address public seniorageAddress;

    //maximum-integer
    uint256 MAX_INT =
        0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;

    uint256 totalStakedSnacks; // Total staked snacks = totalSupply() - rewardSnacks
    uint256 totalRewardDebtSnacks; // Total Reward debt of snacks
    uint256 totalRewardDebtEthSnacks; // Total Reward debt of ethSnacks
    uint256 totalRewardDebtBtcSnacks; // Total Reward debt of btcSnacks

    // Info of each user that stakes tokens (stakedToken)
    mapping(address => UserInfo) public userInfo;
    address[] public userAddressList;

    struct UserInfo {
        uint256 amount; // How many staked tokens the user has provided
        uint256 rewardDebt; // Reward debt of snacks. See explanation below.
        uint256 rewardDebtEthSnacks; // Reward debt of ethSnacks. See explanation below.
        uint256 rewardDebtBtcSnacks; // Reward debt of btcSnacks. See explanation below.
        uint256 lastDepositDate;
    }

    event AdminTokenRecovery(address tokenRecovered, uint256 amount);
    event Deposit(address indexed user, uint256 amount);
    event EmergencyWithdraw(address indexed user, uint256 amount);
    event NewStartAndEndBlocks(uint256 startBlock, uint256 endBlock);
    event NewRewardPerBlock(uint256 rewardPerBlock);
    event RewardsStop(uint256 blockNumber);
    event RewardTransfer(
        address indexed user,
        uint256 snacksReward,
        uint256 ethSnacksReward,
        uint256 btcSnacksReward
    );

    constructor(address _seniorage) {
        seniorageAddress = _seniorage; // Ex.: 0x467927774B59F7cB023863b07960669f958EC19a
    }

    /*
     * @notice Initialize the contract
     * @param _stakedToken: staked token address
     * @param _rewardToken: reward snacks token address
     * @param _rewardEthSnacksToken: reward ethSnacks token address
     * @param _rewardBtcSnacksToken: reward btcSnacks token address
     * @param _admin: admin address with ownership
     */
    function initialize(
        IBEP20 _stakedToken,
        IBEP20 _rewardToken,
        IBEP20 _rewardEthSnacksToken,
        IBEP20 _rewardBtcSnacksToken,
        address _admin
    ) external {
        require(!isInitialized, "Already initialized");

        // Make this contract initialized
        isInitialized = true;

        stakedToken = _stakedToken;
        rewardToken = _rewardToken;
        rewardEthSnacksToken = _rewardEthSnacksToken;
        rewardBtcSnacksToken = _rewardBtcSnacksToken;

        //Approve contracts  for rewardTransfer
        rewardToken.approve(address(this), MAX_INT);
        rewardEthSnacksToken.approve(address(this), MAX_INT);
        rewardBtcSnacksToken.approve(address(this), MAX_INT);

        // Transfer ownership to the admin address who becomes owner of the contract
        transferOwnership(_admin);
    }

    //add msg.sender to userAddressList
    function addUser() internal {
        bool isExist = false;
        for (uint256 i = 0; i < userAddressList.length; i++) {
            if (userAddressList[i] == msg.sender) {
                isExist = true;
                break;
            }
        }
        if (!isExist) {
            userAddressList.push(msg.sender);
        }
    }

    /*
     * @notice Deposit staked tokens and collect reward tokens (if any)
     * @param _amount: amount to withdraw (in rewardToken)
     */
    function deposit(uint256 _amount) external nonReentrant {
        require(_amount > 0, "invalid amount");
        UserInfo storage user = userInfo[msg.sender];
        user.amount = user.amount + _amount;
        totalStakedSnacks = totalStakedSnacks + _amount;
        stakedToken.safeTransferFrom(msg.sender, address(this), _amount);
        user.lastDepositDate = block.timestamp;
        addUser();
        emit Deposit(msg.sender, _amount);
    }

    /*
     * @notice Withdraw staked tokens and collect reward tokens
     * @param _amount: amount to withdraw (in rewardToken)
     */
    function withdraw() external nonReentrant {
        rewardTransfer();
    }

    /*
     * @notice Withdraw staked tokens without caring about rewards rewards
     * @dev Needs to be for emergency.
     */
    function emergencyWithdraw() external nonReentrant {
        UserInfo storage user = userInfo[msg.sender];
        require(user.amount > 0, "Nothing to withdraw");
        uint256 amountToTransfer = user.amount;
        totalStakedSnacks = totalStakedSnacks.sub(user.amount);
        user.amount = 0;
        rewardTransfer();
        if (block.timestamp < user.lastDepositDate + 1 days) {
            stakedToken.safeTransfer(seniorageAddress, amountToTransfer.div(2));
            stakedToken.safeTransfer(msg.sender, amountToTransfer.div(2));
        } else {
            stakedToken.safeTransfer(msg.sender, amountToTransfer);
        }
        emit EmergencyWithdraw(msg.sender, amountToTransfer);
    }

    /*
     * @notice Stop rewards
     * @dev Only callable by owner. Needs to be for emergency.
     */
    function emergencyRewardWithdraw() external onlyOwner {
        rewardTransfer();
    }

    /**
     * @notice It allows the admin to recover wrong tokens sent to the contract
     * @param _tokenAddress: the address of the token to withdraw
     * @param _tokenAmount: the number of tokens to withdraw
     * @dev This function is only callable by admin.
     */
    function recoverWrongTokens(address _tokenAddress, uint256 _tokenAmount)
        external
        onlyOwner
    {
        require(
            _tokenAddress != address(stakedToken),
            "Cannot be staked token"
        );
        require(
            _tokenAddress != address(rewardToken),
            "Cannot be reward token"
        );
        require(
            _tokenAddress != address(rewardEthSnacksToken),
            "Cannot be reward token"
        );
        require(
            _tokenAddress != address(rewardBtcSnacksToken),
            "Cannot be reward token"
        );

        IBEP20(_tokenAddress).safeTransfer(address(msg.sender), _tokenAmount);

        emit AdminTokenRecovery(_tokenAddress, _tokenAmount);
    }

    /*
     * @notice Stop rewards
     * @dev Only callable by owner
     */
    function stopReward() external onlyOwner {
        bonusEndBlock = block.number;
    }
    /*
     * @notice Update reward per block
     * @dev Only callable by owner.
     * @param _rewardPerBlock: the reward per block
     */
    function updateRewardPerBlock(uint256 _rewardPerBlock) external onlyOwner {
        require(block.number < startBlock, "Pool has started");
        rewardPerBlock = _rewardPerBlock;
        emit NewRewardPerBlock(_rewardPerBlock);
    }

    /**
     * @notice It allows the admin to update start and end blocks
     * @dev This function is only callable by owner.
     * @param _startBlock: the new start block
     * @param _bonusEndBlock: the new end block
     */
    function updateStartAndEndBlocks(
        uint256 _startBlock,
        uint256 _bonusEndBlock
    ) external onlyOwner {
        require(block.number < startBlock, "Pool has started");
        require(
            _startBlock < _bonusEndBlock,
            "New startBlock must be lower than new endBlock"
        );
        require(
            block.number < _startBlock,
            "New startBlock must be higher than current block"
        );

        startBlock = _startBlock;
        bonusEndBlock = _bonusEndBlock;

        // Set the lastRewardBlock as the startBlock
        lastRewardBlock = startBlock;

        emit NewStartAndEndBlocks(_startBlock, _bonusEndBlock);
    }

    /*
     * @notice View function to see pending reward on frontend.
     * @param _user: user address
     * @return Pending reward for a given user
     */
    function pendingReward(address _user) external view returns (uint256) {
        return userInfo[_user].rewardDebt;
    }

    /*
     * @notice Update reward variables of the given pool to be up-to-date.
     */
    function updatePool() public {
        if (totalStakedSnacks == 0) {
            return;
        }

        uint256 rewardSnacks = rewardToken.balanceOf(address(this)).sub(
            totalRewardDebtSnacks
        );
        rewardSnacks = rewardSnacks.sub(totalStakedSnacks);
        if (rewardSnacks > 0) {
            for (uint256 i = 0; i < userAddressList.length; i++) {
                userInfo[userAddressList[i]].rewardDebt += rewardSnacks
                    .mul(userInfo[userAddressList[i]].amount)
                    .div(totalStakedSnacks);
            }

            totalRewardDebtSnacks = totalRewardDebtSnacks.add(rewardSnacks);
        }

        uint256 rewardEthSnacks = rewardEthSnacksToken
            .balanceOf(address(this))
            .sub(totalRewardDebtEthSnacks);
        if (rewardEthSnacks > 0) {
            for (uint256 i = 0; i < userAddressList.length; i++) {
                userInfo[userAddressList[i]]
                    .rewardDebtEthSnacks += rewardEthSnacks
                    .mul(userInfo[userAddressList[i]].amount)
                    .div(totalStakedSnacks);
            }

            totalRewardDebtEthSnacks = totalRewardDebtEthSnacks.add(
                rewardEthSnacks
            );
        }

        uint256 rewardBtcSnacks = rewardBtcSnacksToken
            .balanceOf(address(this))
            .sub(totalRewardDebtBtcSnacks);
        if (rewardBtcSnacks > 0) {
            for (uint256 i = 0; i < userAddressList.length; i++) {
                userInfo[userAddressList[i]]
                    .rewardDebtBtcSnacks += rewardBtcSnacks
                    .mul(userInfo[userAddressList[i]].amount)
                    .div(totalStakedSnacks);
            }

            totalRewardDebtBtcSnacks = totalRewardDebtBtcSnacks.add(
                rewardBtcSnacks
            );
        }
    }

    // Safe reward transfer function, just in case if rounding error causes pool to not have enough snacks.
    function rewardTransfer() internal {
        UserInfo storage user = userInfo[msg.sender];
        uint256 rewardDebt = user.rewardDebt;
        if (rewardDebt > 0) {
            if (block.timestamp < user.lastDepositDate + 1 days) {
                rewardToken.safeTransfer(seniorageAddress, rewardDebt.div(2));
                rewardToken.safeTransfer(msg.sender, rewardDebt.div(2));
            } else {
                rewardToken.safeTransfer(msg.sender, rewardDebt);
            }
            user.rewardDebt = 0;
            totalRewardDebtSnacks = totalRewardDebtSnacks.sub(rewardDebt);
        }
        uint256 rewardDebtEthSnacks = user.rewardDebtEthSnacks;
        if (rewardDebtEthSnacks > 0) {
            if (block.timestamp < user.lastDepositDate + 1 days) {
                rewardEthSnacksToken.safeTransfer(seniorageAddress, rewardDebtEthSnacks.div(2));
                rewardEthSnacksToken.safeTransfer(msg.sender, rewardDebtEthSnacks.div(2));
            } else {
                rewardEthSnacksToken.safeTransfer(msg.sender, rewardDebtEthSnacks);
            }
            user.rewardDebtEthSnacks = 0;
            totalRewardDebtEthSnacks = totalRewardDebtEthSnacks.sub(
                rewardDebtEthSnacks
            );
        }
        uint256 rewardDebtBtcSnacks = user.rewardDebtBtcSnacks;
        if (rewardDebtBtcSnacks > 0) {
            if (block.timestamp < user.lastDepositDate + 1 days) {
                rewardBtcSnacksToken.safeTransfer(seniorageAddress, rewardDebtBtcSnacks.div(2));
                rewardBtcSnacksToken.safeTransfer(msg.sender, rewardDebtBtcSnacks.div(2));
            } else {
                rewardBtcSnacksToken.safeTransfer(msg.sender, rewardDebtBtcSnacks);
            }
            user.rewardDebtBtcSnacks = 0;
            totalRewardDebtBtcSnacks = totalRewardDebtBtcSnacks.sub(
                rewardDebtBtcSnacks
            );
        }
        emit RewardTransfer(msg.sender, rewardDebt, rewardDebtEthSnacks, rewardDebtBtcSnacks);
    }

    /*
     * @notice Return reward multiplier over the given _from to _to block.
     * @param _from: block to start
     * @param _to: block to finish
     */
    function _getMultiplier(uint256 _from, uint256 _to)
        internal
        view
        returns (uint256)
    {
        if (_to <= bonusEndBlock) {
            return _to.sub(_from);
        } else if (_from >= bonusEndBlock) {
            return 0;
        } else {
            return bonusEndBlock.sub(_from);
        }
    }

    // Set seniorage address by owner
    function setSeniorage(address seniorage) public onlyOwner {
        seniorageAddress = seniorage;
    }
}

